;; gorilla-repl.fileformat = 1

;; **
;;; # A demo that shows why regularization is important
;; **

;; @@
(ns affectionate-abyss
  (:require [gorilla-plot.core :as plot]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(defn softmax
  [x]
  (let [x (map (partial + (* -1 (apply max x))) x)
        exp (map #(Math/exp %) x)]
    (mapv (partial * (/ 1 (reduce + exp))) exp)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;affectionate-abyss/softmax</span>","value":"#'affectionate-abyss/softmax"}
;; <=

;; @@
(defn evidence
  [scale]
  (mapv (partial * scale)
        [1 1 1.000001]))

(softmax (evidence 1))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-vector'>[</span>","close":"<span class='clj-vector'>]</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-double'>0.33333322222220374</span>","value":"0.33333322222220374"},{"type":"html","content":"<span class='clj-double'>0.33333322222220374</span>","value":"0.33333322222220374"},{"type":"html","content":"<span class='clj-double'>0.3333335555555926</span>","value":"0.3333335555555926"}],"value":"[0.33333322222220374 0.33333322222220374 0.3333335555555926]"}
;; <=

;; @@
(map
  #(vector (str "                                                                                                                Scale: " % "                                                                                                                 ")
           (plot/bar-chart ["first" "second" "last"] (softmax (evidence %)))
           "                                                                                                                 ")
  (map #(Math/pow 10 %) (range 0 10)))
